Jeff Madison, &quot;The Dash Diet: Lower Blood Pressure, Lose Weight, And Feel Great&quot;
2013 | ASIN: B00B83TVMG | 108 pages | EPUB, MOBI, PDF | 3 MB

Ever wonder what the DASH diet is all about? What exactly does DASH mean anyway? Everything you need to know to start the DASH diet is included in this special report. You will learn what the DASH diet is, and the scientific evidence behind this amazing diet. You will learn about hypertension, its causes and consequences. You will learn exercise and eating plans, a food list to take to the grocery store, and you will even find a cookbook that includes breakfast, lunch, snacks, dinner, and dessert. This is a great primer to start you on your way to embarking on a new healthy lifestyle with the DASH diet.
